description:
Trying to Draw Attention away from her Own extramarital Affair, A woman A beautiful sponsors, Young foreign exchange student to catch the eye of her husband. All seems to work well, until the sultry young lady has her own ideas of erotic manipulation, pitting dad against son for her sensual attention. Starring the extraordinary Anissa Kate in a role that she was born to play. The stellar cast also includes James Deen, Marcus London, Seth Gamble and Jennifer Best, and the impressive new star, Jessa Rhodes

